  return (
    <h1>{props.name}</h1>
  )
}

const Content = (props) => {
  return (
    <div>
      <Part part = {props.part1}/>
      <Part part = {props.part2}/>
      <Part part = {props.part3}/>
     </div>
  )
}

const Part = (props) => {
  return (
      <p>{props.part}</p>
  )
}

const Total = (props) => {
  return (
    <>
      <p>Number of exercises {props.totalAmount}</p>
     </>
  )
}



